import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'
import { LandingPage } from './components/Landing/LandingPage.js'
import  {UserHomepage } from './components/UserHomepage/UserHomepage.js'
import JoinRoom from './components/joinRoom/JoinRoom.js';
import MainLobby from './components/MainLobby/MainLobby.js';
import PlayerContainer from './components/MainLobby/PlayerContainer.js/index.js';


function App() {
  return (
    <div>
      <BrowserRouter>
      <Route exact path="/" component={LandingPage}/>
      <Route exact path='/homepage' component={UserHomepage} />
      <Route exact path='/join-room' component={JoinRoom} />
      <Route path='/main-lobby' component={MainLobby}/>
      <Route path='/circle' component={PlayerContainer}/>
      </BrowserRouter>
    </div>
  );
}

export default App;
